import styled from 'styled-components';

export const Container = styled.div`
	padding: 2rem;
	border: 1px solid red;
`;

export const H1 = styled.h1`
	font-size: 2rem;
	font-weight: 300;
`;

export const Div = styled.div`
	margin-top: rem;
	border: 1px solid blue;
`;
